import React from 'react'

const Dashboard = React.lazy(() => import('./views/dashboard/Dashboard'))

// Menu
const Menu = React.lazy(() => import('./views/menu/menu'))
const ListRoles = React.lazy(() => import('./views/menu/list-roles'))
const MenuSetting = React.lazy(() => import('./views/menu/menuSetting'))


const routes = [
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboard', name: 'Dashboard', element: Dashboard },
  { path: '/menu', name: 'Menu', element: Menu, exact: true },
  { path: '/menu/listRoles', name: 'List Roles', element: ListRoles },
  { path: '/menu/menuSetting', name: 'Menu Setting', element: MenuSetting }
]

export default routes
